import React, { useState } from 'react';
//import logo from './logo.svg';
import { InputField } from './components/InputField';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import { HomePage, ProductionPage } from './pages';
import './App.css';

export const App = () => {
  const [val, valChanged] = useState('0');

  return (
    <React.Fragment>
      <header className="App-header" data-theme="light">
        <InputField type={'text'} value={val} required={true} changed={valChanged}/>
      </header>
    	<Router>
        <Route exact path="/" component={HomePage} />
        <Route exact path="/production" component={ProductionPage} />
    	</Router>
    </React.Fragment>
  );
}
